import React from 'react';
import Farmbar from '../Farmbar/Farmbar';

class Splash extends React.Component {
    render() {
        return(
            <div>
                <Farmbar />
                <h2>Splash is sneaky and secretly holding everything displayed by the Navbar BrowserRouter</h2>
            </div>
        )
    }
}

export default Splash;
